// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "../interfaces/IStrategyModule.sol";

// MVP lending placeholder module.
contract LendingModule is IStrategyModule {
    event Lent(address indexed vault, address indexed protocol, uint256 amount);
    event Unlent(address indexed vault, address indexed protocol, uint256 amount);

    // data encoding:
    // mode == 0 => lend; abi.encode(uint8 mode, address protocol, uint256 amount)
    // mode == 1 => unlend; abi.encode(uint8 mode, address protocol, uint256 amount)
    function runStrategy(address vault, bytes calldata data) external override {
        (uint8 mode, address protocol, uint256 amount) = abi.decode(data, (uint8, address, uint256));

        if (mode == 0) {
            // call protocol deposit (omitted)
            emit Lent(vault, protocol, amount);
        } else {
            // call protocol withdraw (omitted)
            emit Unlent(vault, protocol, amount);
        }
    }
}

contracts/modules/RebalanceModule.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "../interfaces/IStrategyModule.sol";

// MVP rebalance placeholder: emits event and assumes off-chain automation determines when to trigger.
contract RebalanceModule is IStrategyModule {
    event Rebalanced(address indexed vault, uint256 thresholdBps, address from, address to);

    // data encoding: abi.encode(uint256 thresholdBps, address fromAssetAdapter, address toAssetAdapter, uint256 amount)
    function runStrategy(address vault, bytes calldata data) external override {
        (uint256 thresholdBps, address fromAdapter, address toAdapter, uint256 amount) =
            abi.decode(data, (uint256, address, address, uint256));

        // In a real module, check APY sources via oracles/adapters and move funds accordingly.
        // Here, we just emit an event to prove execution.
        emit Rebalanced(vault, thresholdBps, fromAdapter, toAdapter);

        // For MVP: pretend moving funds by calling adapters (omitted to keep safe/simplified).
        // e.g., IAdapter(fromAdapter).withdraw(amount); IAdapter(toAdapter).deposit(amount);
    }
}

contracts/modules/StakeModule.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "../interfaces/IStrategyModule.sol";
import "../utils/SafeTransferLib.sol";

// MVP "staking" placeholder module:
// For demonstration, it simply logs intent and could forward native to a staking adapter.
contract StakeModule is IStrategyModule {
    using SafeTransferLib for address;

    event Staked(address indexed vault, uint256 amount, address target);

    // data encoding: abi.encode(address targetStakingContract, uint256 amount)
    function runStrategy(address vault, bytes calldata data) external override {
        (address target, uint256 amount) = abi.decode(data, (address, uint256));
        require(vault.balance >= amount, "StakeModule: insufficient vault balance");

        // forward native ETH from vault to target staking adapter via low-level call
        (bool ok, ) = target.call{value: amount}("");
        require(ok, "StakeModule: stake call failed");

        emit Staked(vault, amount, target);
    }
}

